INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (1.5, 160, 101, 0.029, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0, 1, 105, 0, 122601, 1, 110, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 120, 102, 0.014, 0, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0, 2, 111, 1, 122401, 2, 105, 3);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 350, 103, 0.017, 0, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 1, 3, 105, 0, 122501, 3, 110, 2);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (1.5, 130, 104, 0.016, 0, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0, 4, 105, 1, 107501, 4, 110, 3);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 160, 105, 0.014, 1, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0, 5, 105, 0, 107601, 5, 110, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (3.5, 255, 106, 0.029, 0, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 1, 6, 103, 0, 107801, 6, 120, 2);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (3.5, 160, 107, 0.013, 1, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0, 7, 103, 0, 110601, 7, 120, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 350, 108, 0.014, 0, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 1, 8, 103, 0, 110401, 8, 110, 2);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (1.5, 130, 109, 0.012, 0, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0, 9, 100, 1, 110501, 9, 105, 3);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 200, 110, 0.014, 1, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0, 10, 103, 0, 115701, 10, 105, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 350, 111, 0.071, 0, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 1, 11, 103, 0, 113601, 11, 105, 2);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (1.5, 130, 112, 0.014, 0, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0, 12, 103, 1, 107901, 12, 120, 3);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (1.5, 200, 113, 0.022, 1, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0, 13, 105, 0, 108001, 13, 110, 2);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 160, 114, 0.031, 1, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0, 14, 108, 0, 110301, 14, 110, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (0.5, 130, 115, 0.036, 0, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0, 15, 105, 1, 107701, 15, 110, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (3.5, 350, 116, 0.048, 0, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 1, 16, 95, 0, 113101, 16, 110, 2);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (1.5, 130, 117, 0.043, 0, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0, 17, 105, 1, 113301, 17, 105, 3);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (1.5, 130, 118, 0.018, 0, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0, 18, 95, 1, 113201, 18, 105, 2);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 160, 119, 0.021, 1, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0, 19, 108, 0, 117001, 19, 110, 2);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 255, 120, 0.036, 0, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 1, 20, 105, 0, 113501, 20, 110, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 350, 121, 0.02, 0, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 1, 21, 105, 0, 113401, 21, 105, 3);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 130, 122, 0.018, 0, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0, 22, 105, 1, 110101, 22, 110, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (3.5, 160, 123, 0.03, 1, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0, 23, 111, 0, 110001, 23, 105, 3);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (1.5, 130, 124, 0.027, 0, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0, 24, 103, 1, 117201, 24, 110, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (3.5, 160, 125, 0.02, 1, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0, 25, 108, 0, 117301, 25, 105, 2);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 350, 126, 0.04, 0, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 1, 26, 105, 0, 117401, 26, 110, 3);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (3.5, 350, 127, 0.009, 0, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 1, 27, 105, 0, 117101, 27, 110, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (3.5, 255, 128, 0.022, 0, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 1, 28, 105, 0, 122901, 28, 120, 1);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (2.5, 130, 129, 0.028, 0, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0, 29, 105, 1, 122801, 29, 110, 3);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES (3.5, 130, 130, 0.023, 1, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0, 30, 108, 0, 122701, 30, 105, 2);
